	@Test
	public void updateNicknameAndPhoto() throws Exception {
		File excel=new File("D:/xlsx/");
			try {
				// String encoding = "GBK";
				if (excel.isFile() && excel.exists()) { // 判断文件是否存在

					String[] split = excel.getName().split("\\."); // .是特殊字符，需要转义！！！！！
					Workbook wb;
					// 根据文件后缀（xls/xlsx）进行判断
					if ("xls".equals(split[1])) {
						FileInputStream fis = new FileInputStream(excel); // 文件流对象
						wb = new HSSFWorkbook(fis);
					} else if ("xlsx".equals(split[1])) {
						wb = new XSSFWorkbook(excel);
					} else {
						System.out.println("文件类型错误!");
						return;
					}
					 int topType = 1;
					// 开始解析
					Sheet sheet = wb.getSheetAt(0); // 读取sheet 0
				   
					int firstRowIndex = sheet.getFirstRowNum() + 1; // 第一行是列名，所以不读
					int lastRowIndex = sheet.getLastRowNum();
					System.out.println("firstRowIndex: " + firstRowIndex);
					System.out.println("lastRowIndex: " + lastRowIndex);
					System.out.println("------------------------------");
					for (int rIndex = firstRowIndex; rIndex <= lastRowIndex; rIndex++) { // 遍历行
						Row row = sheet.getRow(rIndex);
						if (row != null) {
						
							Cell nameCell = row.getCell(0);
							Cell infoCell = row.getCell(1);
							Cell photoCell = row.getCell(2);
							
							String name = (nameCell == null ? "":nameCell.toString());
							String info = (infoCell == null ? "" : infoCell.toString());
							String photo = (photoCell == null ? "" : photoCell.toString());
					       System.out.println(name+"  "+info+"  "+photo);
					       Map<String, String> params = new HashMap<>();
							params.put("accid", name);
							params.put("name", info);
							params.put("icon", "http://cdn.vmi2.liaomeivideo.com"+photo);
							assertEquals(200, neteaseAgent.updateUser(params).getIntValue("code"));
							Thread.currentThread().sleep(300);
						}
					}
				} else {
					System.out.println("找不到指定的文件");
				}
			} catch (Exception e) {
				e.printStackTrace();
			}
	}
	
